 her father and her village's elders before    
 marrying him. Arvasu's brother is Parvasu who 
 has been conducting a major prayer ceremony to
 appease Devraj Indra so that their region may 
 get rain. Arvasu's father is Raibhya,who      
 dislikes both his sons, and wishes that he    
 cremate them before his death. Raibhyu,       
